import React from "react";
import {useLocation} from 'react-router-dom'
function useQuery() {
    const { search } = useLocation();

    return React.useMemo(() => new URLSearchParams(search), [search]);
  }
export default  function CompareFish(props){
    let fishAId=useQuery().get('fishA')
    let fishBId=useQuery().get('fishB');
    const fish=(
    <article>
            <h1>Name:<span>{props.fish.id}</span></h1>
            <h2> ID: <span> {props.fish.name}</span></h2>
            <h2> Selling Price: </h2>
            <h3> Tom Nook's Cranny Shop: <span> {props.fish.price} </span> </h3>
            <h3> CJ: <span> {props.fish['price-cj']} </span> </h3>
            <h3> Location/Weather: <span> {props.fish.location} </span> </h3>
            <h3> Time of Day: <span> {props.fish['time-array']} </span> </h3>
            <h3> Shadow Size: <span> {props.fish.shadow} </span> </h3>
            <h3>Rarity: <span> {props.fish.rarity} </span> </h3>
            <h3> Season: <span> {props.fish['month-array-northern'], props.fsh['month-array-southern']} </span> </h3>

    </article>
    );
    return (
    <section>
         <fish/>
        <fish/>    
    </section>);

}
